def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if bins[i] >= item:
            priorities[i] = item / bins[i] + 0.1
            if item <= 20:
                priorities[i] += 0.2
            else:
                priorities[i] += 0.5
        elif bins[i] >= item / 2:
            priorities[i] = 0.5 * item / bins[i] + 0.2
            if item > 5:
                priorities[i] -= 0.1
        else:
            count = 0
            while item > bins[i]:
                item -= bins[i]
                count += 1

            if count % 3 == 0:
                priorities[i] = 0.8 * count + item / bins[i] + 0.3
                if count == 6:
                    priorities[i] += 0.8
            elif count % 3 == 1:
                priorities[i] = 0.7 * count + item / bins[i] + 0.3
                if count == 4:
                    priorities[i] -= 0.5
                else:
                    priorities[i] += 0.2
            else:
                priorities[i] = 0.9 * count + item / bins[i] + 0.3
                if count == 3:
                    priorities[i] -= 0.3
                elif count == 5:
                    priorities[i] += 0.4
                elif count == 7:
                    priorities[i] -= 0.2
                elif count == 9:
                    priorities[i] += 0.7
                else:
                    priorities[i] += 0.1 if item > 10 else 0.05

                for j in range(count):
                    priorities[i] += 0.1
                    if item > 10:
                        priorities[i] += 0.2
                        if item % 2 == 0:
                            priorities[i] -= 0.1
                        else:
                            priorities[i] += 0.1
                    else:
                        priorities[i] += 0.05
    return priorities
